import React from 'react';
import {Button} from '@material-ui/core';
import { Link } from 'react-router-dom';
import Navbar1 from './Navbar1';
import icon11 from './images/icon1.png';
import icon12 from './images/icon21.png';
import './style.css';

const imagesPath = {
    minus: "https://images.vexels.com/media/users/3/131484/isolated/preview/a432fa4062ed3d68771db7c1d65ee885-minus-inside-circle-icon-by-vexels.png",
    plus: "https://cdn3.iconfinder.com/data/icons/glypho-generic-icons/64/plus-big-512.png"
  }

const Home = () => {
  return (
    <div>
        <Navbar1/>
        <div className="container2">
        <div className="menu">
            <img  src={icon11} onClick={this.toggleImage} />
      </div>
        <div className="devices">
            <p>fegrd</p>
        </div>
        <div className="analytics">
            <p>fegrd</p>
        </div>
        </div>
    </div>
  );
};

export default Home;
